$(function() {

	//splitter
	let els = document.querySelectorAll(".js-splitme");
	[].forEach.call(els, function(el) {
		el.outerHTML = Splitter(el.outerHTML, '<span class="letter">$</span>');
	});


	//GSUP Animation
	let tl = new TimelineMax();

	tl.fromTo('.loader__inside', 3, {scale: 1}, {scale: 1000, onComplete: function(){
			$('.loader').remove();
		}})
		.from('.logo', 2, {opacity: 0, left: 1600}, "-=2")
		.staggerFromTo('.main-header__phone a', 0.5, {opacity:0,x:100}, {opacity:1,x:0}, 0.25, "-=0")
		.staggerFromTo('.main-header__title-h1 .letter', 0.3, {opacity:0,y:20}, {opacity:1,y:0,ease: Back.easeOut.config(3)}, 0.05)
		.from('.main-header__title-span', 3, {opacity: 0, left: 1600}, "-=3")
		.staggerFromTo('.main-header__text', 0.5, {opacity:0,x:100}, {opacity:1,x:0}, 0.25)
		.from('.main-header__button', 2, {opacity:0, bottom: 100,ease: Back.easeOut.config(6)});



	//Full Page 
	$('#fullpage').fullpage({
		anchors:['firstPage', 'secondPage', 'lastPage'],
		verticalCentered: false,
		scrollOverflow: true,
		navigation: true,
		responsiveWidth: 991,
		onLeave: function(index, nextIndex, direction){
			var leavingSection = $(this);

			//после покидания раздела 1
			if(index == 1 && direction =='down'){
				$('#fp-nav').addClass('dark-line')
			}

			else if(index == 2 && direction == 'up'){
				$('#fp-nav').removeClass('dark-line')
			}
		}
	});

	//click on menu
	$('.left-menu__icon').on('click', function() {
		$('.left-menu').css('width', '280px');
		$('.social-link').css('transform', 'rotateZ(0deg)');
	});
	$('#fullpage').on('click', function() {
		if($(window).width() < 480) {
			$('.left-menu').css('width', '45px');
		} else {
			$('.left-menu').css('width', '78px');
		}
		$('.social-link').css('transform', 'rotateZ(-90deg)');
	})
	//sider
	$(".owl-carousel").owlCarousel({
		nav: true,
		items:1,
		dots: false,
		navText: ['<img src="img/arrow-left.png" alt="">', '<img src="img/arrow-right.png" alt="">'],
	});



	


});